import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  bottom: 0;
  left: 0;
  max-width: 54rem;
  opacity: 0;
  padding: 0 2rem;
  position: fixed;
  width: 100%;

  .sticky-trigger-1 {
    margin-top: 50vh;
  }
`;

function SlideTwo() {
  return (
      <>
        <div className='sticky-trigger-1' />
        <Plx>
          <StyledSlideTwo>
              <CarInfoDisplay />
          </StyledSlideTwo>
        </Plx>
      </>
  );
}

export default SlideTwo;
